    UserService.getPublicContent().then(
      (response) => {
        setContent(response.data);
      },
      (error) => {
        const _content =
          (error.response && error.response.data) ||
          error.message ||
          error.toString();

        setContent(_content);
      }
    );
  }, []);

  return (
    <div className="container p-5 my-5">
      <div className="card ">
      <header className="jumbotron justify-content-center">
        <h3>{content}</h3>
